SET NAMES utf8mb4;

use testdb;

CREATE TABLE IF NOT EXISTS `somenzz_users`(
   `user_id` INT UNSIGNED AUTO_INCREMENT comment '自增主键',
   `name` VARCHAR(100) NOT NULL comment '名称',
   `email` VARCHAR(40) comment '邮箱',
   `age` INT comment '年龄',
   `create_at` DATE comment '创建日期',
   `last_login` TIMESTAMP comment '上次登陆时间',
   PRIMARY KEY ( `user_id` )
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户表';;


